import React from 'react';

const Rank = (user) => {
	const { name, entries } = user;
	return (
		<div>
			<div className='white f5'>
				{`${name}, sua posição atual é:`}
			</div>
			<div className='white f3'>
				{entries}
			</div>
		</div>

	)
}

export default Rank;
